// Function to either get the part ID if it exists, else return null

export function getPartID(str) {
    const regex = /PS\d+/;

    if (regex.test(str)) {
        const match = str.match(regex);
        console.log(match)
        console.log(match[0])
        return match[1]
    } else {
        return null
    }
}
